import React from "react";

import styled from "styled-components";
import TextSection from "./TextSection";

const FirstSections = styled.section``;

const SectionFirst = () => {
  return (
    <FirstSections className="flex">
      <TextSection />
    </FirstSections>
  );
};

export default SectionFirst;
